import { Route, Routes } from 'react-router-dom';

const  RoutesWithNotFound = ({children}) => {
    return (
        <Routes>
            {children}
            <Route path="*" element={<>Not Found</>}/>
        </Routes>
    )
}

export default RoutesWithNotFound
